/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `claim_user` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint DEFAULT NULL,
  `from_user_id` bigint DEFAULT NULL,
