INSERT INTO `content_main_gallery` VALUES (355,NULL,'TYPE_AFFIRMATION','Бесконечный закон изобилия течет сквозь меня. Я канал процветания и любви, через который приходят все хорошие вещи этого мира.',NULL,NULL,NULL,467,NULL,'2022-09-22 10:08:05','2022-09-22 10:08:05',0,'Бесконечный закон изобилия течет сквозь меня. Я канал процветания и любви, через который приходят все хорошие вещи этого мира.','Бесконечный закон изобилия течет сквозь меня. Я канал процветания и любви, через который приходят все хорошие вещи этого мира.',NULL,NULL,'Бесконечный закон изобилия течет сквозь меня. Я канал процветания и любви, через который приходят все хорошие вещи этого мира.',NULL),(356,NULL,'TYPE_AFFIRMATION','Я открыт(а) всем дарам Вселенной. С каждым днем я становлюсь мудрее, богаче, успешнее. Я здоров и счастлив. Любовь во мне и вокруг меня.',NULL,NULL,NULL,468,NULL,'2022-09-22 10:08:38','2022-09-22 10:08:38',0,'Я открыт(а) всем дарам Вселенной. С каждым днем я становлюсь мудрее, богаче, успешнее. Я здоров и счастлив. Любовь во мне и вокруг меня.','Я открыт(а) всем дарам Вселенной. С каждым днем я становлюсь мудрее, богаче, успешнее. Я здоров и счастлив. Любовь во мне и вокруг меня.',NULL,NULL,'Я открыт(а) всем дарам Вселенной. С каждым днем я становлюсь мудрее, богаче, успешнее. Я здоров и счастлив. Любовь во мне и вокруг меня.',NULL),(357,NULL,'TYPE_AFFIRMATION','Я говорю жизни — «ДА», а счастью — «ЗДРАВСТВУЙ»!',NULL,NULL,NULL,469,NULL,'2022-09-22 10:08:59','2022-09-22 10:08:59',0,'Я говорю жизни — «ДА», а счастью — «ЗДРАВСТВУЙ»!','Я говорю жизни — «ДА», а счастью — «ЗДРАВСТВУЙ»!',NULL,NULL,'Я говорю жизни — «ДА», а счастью — «ЗДРАВСТВУЙ»!',NULL),(358,NULL,'TYPE_AFFIRMATION','Я ясно знаю, чего хочу. Желания наполняют меня энергией. Мои желания воплощаются в ежедневных решениях и поступках.',NULL,NULL,NULL,470,NULL,'2022-09-22 10:09:19','2022-09-22 10:09:19',0,'Я ясно знаю, чего хочу. Желания наполняют меня энергией. Мои желания воплощаются в ежедневных решениях и поступках.','Я ясно знаю, чего хочу. Желания наполняют меня энергией. Мои желания воплощаются в ежедневных решениях и поступках.',NULL,NULL,'Я ясно знаю, чего хочу. Желания наполняют меня энергией. Мои желания воплощаются в ежедневных решениях и поступках.',NULL),(359,NULL,'TYPE_AFFIRMATION','Моя душа настроена на любовь и мудрость! Мои мысли плодотворны! Мой разум открыт для прогресса и роста! Я прекрасный человек и достоин самого лучшего в этом мире! Вселенная безусловно и полностью поддерживает меня!',NULL,NULL,NULL,471,NULL,'2022-09-22 10:09:47','2022-09-22 10:09:47',0,'Моя душа настроена на любовь и мудрость! Мои мысли плодотворны! Мой разум открыт для прогресса и роста! Я прекрасный человек и достоин самого лучшего в этом мире! Вселенная безусловно и полностью поддерживает меня!','Моя душа настроена на любовь и мудрость! Мои мысли плодотворны! Мой разум открыт для прогресса и роста! Я прекрасный человек и достоин самого лучшего в этом мире! Вселенная безусловно и полностью поддерживает меня!',NULL,NULL,'Моя душа настроена на любовь и мудрость! Мои мысли плодотворны! Мой разум открыт для прогресса и роста! Я прекрасный человек и достоин самого лучшего в этом мире! Вселенная безусловно и полностью поддерживает меня!',NULL),(365,7,'TYPE_YOGA_TO_ME','Урок №1',NULL,NULL,NULL,NULL,NULL,'2022-11-04 09:16:03','2022-11-22 20:11:51',0,NULL,NULL,NULL,'https://vimeo.com/765973745','Lesson №1',NULL),(366,7,'TYPE_YOGA_TO_ME','Урок №2',NULL,NULL,NULL,NULL,NULL,'2022-11-04 09:16:34','2022-11-08 10:06:18',0,NULL,NULL,NULL,'https://vimeo.com/767183132','Lesson №2',NULL),(367,7,'TYPE_YOGA_TO_ME','Урок №3',NULL,NULL,NULL,NULL,NULL,'2022-11-04 09:17:04','2022-11-22 20:11:34',0,NULL,NULL,NULL,'https://vimeo.com/767183849','Lesson №3',NULL),(373,7,'TYPE_YOGA_TO_ME','Урок №4',NULL,NULL,NULL,NULL,NULL,'2022-11-14 10:11:10','2022-11-22 20:11:21',0,NULL,NULL,NULL,'https://vimeo.com/767184325','Lesson №4',NULL),(374,7,'TYPE_YOGA_TO_ME','Урок №5',NULL,NULL,NULL,NULL,NULL,'2022-11-14 10:11:48','2022-11-