INSERT INTO `term_of_use` VALUES (1,'<h4 align=\"center\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" center;\"=\"\"><p class=\"MsoNormal\" align=\"center\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 17.12px;\">TalktoMe<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 17.12px;\">&nbsp;</span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">Приложение&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 17.12px;\">TalktoMe</span><span style=\"font-size: 12pt; line-height: 17.12px;\">&nbsp;является сервисом для оказания психологических услуг между клиентом и психологом. Здесь вы сможете найти подходящего для Вас психолога и поговорить по аудио/видео связи записавшись к нему в удобное для Вас время. Каждый специалист в праве ставить свою ставку денежного вознаграждения за один час работы, вы сможете найти подходящего психолога не только рассмотрев его навыки, но и удобную оплату за час приема.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">Также у нас вы найдете огромное кол-во аудио медитаций разработанные специалистами в этой сфере.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">Сможете послушать прекрасные звуки природы, провести свою медитацию под музыку предоставленную в нашем приложении.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">Помимо всего прочего у нас вы сможете научиться различным упражнениям из йоги, пройти несколько уроков для поддержания своего любимого тела в прекрасной форме.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">Видео и аудио контент доступен в приложении по подписке:<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">1 месяц – 1099 тенге<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">3 месяца – 2970 тенге<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">6 месяцев – 5799 тенге<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 17.12px;\">1 год – 9&nbsp;999 тенге<o:p></o:p></span></p></h4><h4 align=\"center\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" center;\"=\"\"><br></h4><h4 align=\"center\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" center;\"=\"\">Публичная оферта (предложение)&nbsp;оказания электронных услуг &nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;указать наименование лица от которого исходит предложение</span></span><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\">Настоящий предложение&nbsp;<strong>Индивидуального предпринимателя ИП Пасюков Сергей Евгеньевич&nbsp;</strong>&nbsp;(далее – Исполнитель) в лице<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">Пасюкова Сергея Евгеньевича</span></span>, действующего (ей) на основании свидетельства о государственной регистрации серия&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">09915</span></span>№&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">0046415</span></span>&nbsp;от&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">06.03.2012</span></span>&nbsp;г., выданного<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">КАЗАХСТАН РЕСПУБЛИКАСЫ КАРЖЫ МИНИСТ</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">I</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">РЛ</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">I</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">Г</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">I</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">Н</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">I</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">Н САЛЫК КОМИТЕТ</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">I</span></span>&nbsp;(далее - Исполнитель), индивидуальный-идентификационный номер 890925300072 ,&nbsp;адрес места нахождения:&nbsp; г.Алматы Улица Навои дом 37 кв 94 электронный адрес:&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать доменное имя</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">&nbsp;-&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">TalktoMe</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">.</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">one</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">, а также адрес электронной почты Исполнителя</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">passyukov</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">@</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">mail</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">.</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">ru</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">,&nbsp;</span></span>номер телефона&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">+77028082808</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">,</span></span>&nbsp;ИИК&nbsp; KZ77722S000010004297 БИК CASPKZKA ,&nbsp;в&nbsp; AO \"Kaspi Bank\" &nbsp;&nbsp;Кбе&nbsp; AO \"Kaspi Bank\" ,&nbsp;является&nbsp; Публичной офертой, по которой&nbsp;Исполнитель делает предложение заключить Договор&nbsp;оказания электронных &nbsp;услуг, которые оказываются &nbsp;с применением информационных технологий,&nbsp;на указанных в предложении условиях с любым, кто отзовется. Данное предложение содержит все существенные условия, т.е. условия, которые признаны существенными законодательством или необходимы для оказания&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">сервиса по оказыванию консультативных услуг</span></span>,&nbsp;<span lang=\"RU\">продажа подписки на аудио и видео предоставляемый контент.</span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.</span>&nbsp;<strong>ПОНЯТИЯ И ТЕРМИНЫ, ИСПОЛЬЗУЕМЫЕ В НАСТОЯЩЕЙ ПУБЛИЧНОЙ ОФЕРТЕ</strong><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.1.</span>&nbsp;<strong>Услуги</strong>&nbsp;&nbsp;-&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">консультации психологов</span></span>, т.е. электронные услуги (в том числе информационные, интерактивные, транзакционные), предоставляемые на территории Республики Казахстан совершеннолетним дееспособным физическим и юридическим лицам, с применением Информационных технологий;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.2.</span>&nbsp;<strong>Договор - Оферта</strong>&nbsp;- настоящее предложение, которое делает Исполнитель любому, кто отзовется, и которое содержит&nbsp;все существенные условия. &nbsp;Данное предложение содержит все условия, которые признаны существенными законодательством или необходимы для оказания Услуг&nbsp;,&nbsp;а также те условия, относительно которых по заявлению Исполнителя должно быть достигнуто соглашение;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.3.</span>&nbsp;<strong>Акцепт</strong>&nbsp;-&nbsp;ответ Пользователя или совершение Пользователем действий, определенных Договором-Офертой, свидетельствующих о полном и безоговорочном принятии условий Договора-Оферты;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.4.</span>&nbsp;<strong>Информационная технология</strong>&nbsp;- совокупность методов, производственных процессов и программно-технических средств, объединенных в технологический комплекс, обеспечивающий сбор, создание, хранение, накопление, обработку, поиск, вывод, копирование, передачу и распространение информации;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.5.</span>&nbsp;<strong>Сайт</strong>&nbsp;-&nbsp;интернет-ресурс &nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">talktoMe</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">.</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">one</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span>т.е. информация (в текстовом, графическом, аудиовизуальном или ином виде), размещенная&nbsp;на&nbsp;аппаратно-программном комплексе,&nbsp;имеющем&nbsp;уникальный сетевой адрес и (или)&nbsp;доменное имя&nbsp;и&nbsp;функционирующем&nbsp;в Интернете;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.6.</span>&nbsp;<strong>Посетитель&nbsp;</strong>- лицо &nbsp;посетившее Сайт, без цели регистрации на нем или размещения Заказа;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.7.</span>&nbsp;<strong>Пользователь</strong>&nbsp;— лицо осуществившее Акцепт Договора - Оферты Исполнителя;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.8.</span>&nbsp;<strong>Заказ -&nbsp;</strong>задание Пользователя на оказание Услуг, оформленное в соответствии с условиями Договора-Оферты;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.9.</span>&nbsp;<strong>Исключительное право&nbsp;</strong>- имущественное право автора или иного правообладателя на использование произведения, исполнения, постановки, фонограммы, передачи организаций эфирного или кабельного вещания любым способом по своему усмотрению в течение определенного срока;&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.10.</span>&nbsp;<strong>Стороны</strong>- сторонами Договора-Оферты являются совместно Исполнитель и Пользователь;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.11.</span>&nbsp;<b>Персональные данные</b>&nbsp;- сведения, регламентированные Договором - Офертой, относящиеся к определенному физическому лицу, зафиксированные на электронном, бумажном и (или) ином материальном носителе;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.12.</span>&nbsp;<b>Сбор Персональных данных</b>&nbsp;– действия, направленные на получение Персональных данных;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.13.</span>&nbsp;<strong>Обработка Персональных данных</strong>&nbsp;– действия, направленные на накопление, хранение, изменение, дополнение, использование, распространение, обезличивание, блокирование и уничтожение Персональных данных;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.14.</span>&nbsp;<strong>Третьи лица</strong>&nbsp;- &nbsp;лица связанные, как в настоящее время, так и в будущем, с Исполнителем обстоятельствами или правоотношениями по Сбору, Обработке и защите Персональных данных&nbsp;Пользователя.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;\"=\"\"><span class=\"number\">2.</span>&nbsp;ПРЕДМЕТ ДОГОВОРА - ОФЕРТЫ<o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.1.</span>&nbsp;Исполнитель обязуется по Заказу&nbsp;<span lang=\"RU\">оказать услуги</span>, а Пользователь обязуется оплатить эти Услуги. При этом условия оказания Услуг определены в настоящем Договоре-Оферте и могут быть приняты Пользователем не иначе как путем присоединения к предложенному Договору-Оферте в целом посредством принятия (Акцепта) предложения Исполнителя.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.</span>&nbsp;Вместе с передачей Объекта Пользователю передается право использовать Объект &nbsp;следующими способами:&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.1.</span>&nbsp;воспроизводить Объект (право на воспроизведение);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.2.</span>&nbsp;распространять оригинал или экземпляры Объекта любым способом: продавать, менять, сдавать в прокат (внаем), совершать иные операции, в том числе в открытой информационно-коммуникационной сети (право на распространение);<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.3.</span>&nbsp;импортировать экземпляры Объекта в целях распространения, включая экземпляры, изготовленные с разрешения автора или иного обладателя авторских прав (право на импорт);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.4.</span>&nbsp;публично показывать Объект (право на публичный показ);<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.5.</span>&nbsp;публично сообщать Объект (сообщать произведение для всеобщего сведения), включая сообщение в эфир или по кабелю (право на публичное сообщение);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.6.</span>&nbsp;сообщать Объект в эфир, включая первое и (или) последующее сообщение в эфир для всеобщего сведения (право на сообщение в эфир);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.7.</span>&nbsp;сообщать Объект по кабелю, включая первое и (или) последующее сообщение по кабелю для всеобщего сведения (право на сообщение по кабелю);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.8.</span>&nbsp;переводить Объект (право на перевод);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.9.</span>&nbsp;переделывать, аранжировать или другим образом перерабатывать Объект (право на переработку);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.10.</span>&nbsp;доводить Объект до всеобщего сведения (право на доведение до всеобщего сведения);&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.2.11.</span>&nbsp;осуществлять иные действия, не противоречащие законодательству.&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.3.</span>&nbsp;Действие передаваемого по Договору-Оферте Исключительного права распространяется на всей территории&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span><em>на всей территории Республики Казахстан и Российской Федерации</em><em><span lang=\"RU\">,Турции,Украины,Кыргыстан,Таджикистан,Узбекистан</span></em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.&nbsp;​</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.4.</span>&nbsp;Порядок совершения Акцепта - предложение Исполнителя считается принятым Пользователем с момента&nbsp;совершения им любого из ниже перечисленных действий:&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.4.1.</span>&nbsp;оплаты Услуг Пользователем в порядке и на условиях, указанных в Договоре - Оферте;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.4.2.</span>&nbsp;совершение Пользователем действий, указывающих на принятие Договора-Оферты, в частности&nbsp;<em>&nbsp;проставления галочки в соответствующем поле страницы Сайта, свидетельствующей о принятии Договора – Оферты</em><em><span lang=\"RU\">.</span></em><span lang=\"RU\"><o:p></o:p></span></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.4.3.</span>&nbsp;регистрации на Сайте;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.4.4.</span>&nbsp;оформление Заказа;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.5.</span>&nbsp;При совершении Пользователем Акцепта в выше описанном порядке считается, что:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.5.1.</span>&nbsp;Пользователь ознакомлен, согласен и принял предложение Исполнителя;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.5.2.</span>&nbsp;Акцепт Исполнителем получен;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.5.3.</span>&nbsp;Договор – Оферта заключен, не требует двустороннего подписания и действителен в электронном виде;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.5.4.</span>&nbsp;письменная форма договора соблюдена.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.6.</span>&nbsp;Исполнитель имеет право отозвать по свое предложение о заключении Договора-Оферты в любое время, но это не является основанием для отказа от обязательств Исполнителя по принятым к исполнению Заказам.&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">Исполнитель обязуется разместить уведомление об отзыве Договора-Оферты, на своем Сайте, с указанием точного времени отзыва Договора-Оферты, не менее чем за указать срок&nbsp;</span></span><em>&nbsp;12 часов</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">до факта наступления события отзыва (приостановки) действия Договора - Оферты.</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">2.7.</span>&nbsp;Сайт может быть временно недоступен, частично или полностью, и соответственно, оказание Услуг может быть временно прекращено, частично или полностью по причине проведения профилактических или иных работ, а также по любым другим причинам технического характера. Исполнитель имеет право периодически проводить необходимые профилактические или иные работы с предварительным уведомлением Пользователей или без такового.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;\"=\"\"><span class=\"number\">3.</span>&nbsp;УСЛОВИЯ ОКАЗАНИЯ УСЛУГ<o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.1.</span>&nbsp;Пользователь обязуется исполнять нижеследующие правила пользования Сайтом:&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">(указать какими именно правилами должен руководствоваться Пользователь, например,</span></span><o:p></o:p></p><ul type=\"disc\" style=\"margin-bottom: 0cm; letter-spacing: normal; text-align: start; color: rgb(0, 0, 0); font-size: medium;\"><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">До момента регистрации Посетитель обязан ознакомиться с условиями Договора - Оферты, в случае несогласия Посетителя с условиями изложенными в Договоре - Оферте, он не должен проходить регистрацию на Сайте Исполнителя и (или) получать какие-либо Услуги предоставляемые Исполнителем.</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Посетитель обязан зарегистрироваться на Сайте Исполнителя, для этого Посетитель в разделе \"регистрация\" указать прямую ссылку&nbsp;на раздел сайта \"регистрация\" должен заполнить обязательные поля для регистрации;</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><em>&nbsp;Данные вносимые при регистрации Пользователем должны быть достоверными, и Пользователь несет самостоятельно ответственность за достоверность и правильность вносимых данных;</em><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><em>&nbsp;В случае если при регистрации Пользователя на Сайте Исполнителя требуется вести пароль, тогда Пользователь несет самостоятельно ответственность за сохранение конфиденциальности своего пароля.;</em><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><em>В случае несанкционированного &nbsp;использования Аккаунта и (или) пароля Пользователя, последний обязуется незамедлительно уведомить об этом Исполнителя. Исполнитель не несет ответственности за любые убытки причиненные Пользователю в связи с несанкционированным использованием его Аккаунта и (или) пароля;</em><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">При пользовании Сайтом Пользователю&nbsp;запрещаются любые действия, направленные на&nbsp;получение несанкционированного доступа к&nbsp;ресурсам сервера Исполнителя, персональным учетным и&nbsp;иным данным других Пользователей, а&nbsp;также любым другим данным, доступным через сеть Интернет.</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Пользование Сайтом и (или) использование Услуг Исполнителя должно осуществляться Пользователем только для законных целей и&nbsp;законными способами в&nbsp;соответствии с законодательством.</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Пользователь самостоятельно следит за изменениями в условиях Договора - Оферты вносимыми Исполнителем.</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать иные правила пользования&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">приложением&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">;)</span></span><o:p></o:p></li></ul><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.3.</span>&nbsp;Условия оказания (приобретения) Услуг - для оказания Услуг (и) Пользователь оформляет Заказ. Оформляя Заказ, Пользователь определяет вид необходимой Услуги:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.3.1.</span>&nbsp;разовая Услуга, т.е. одна Услуга или Услуги, оказываемые&nbsp;единожды;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.3.2.</span>&nbsp;регулярная Услуга, т.е. Услуга, оказываемая на постоянной (непрерывной) основе и (или) в течение длительного времени и (или) совокупность Услуг, объединенных определенным признаком;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.3.3.</span>&nbsp;неоднократная Услуга, т.е. Услуга, оказываемая не постоянно, а только при возникновении потребности у Пользователя по его Заказу.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.4.</span>&nbsp;В рамках исполнения Договора - Оферты Пользователем может быть оформлено неограниченное количество Заказов.&nbsp;При этом исполнение определенного Заказа (оказание Услуги) не прекращает действие Договора-Оферты.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.5.</span>&nbsp;Порядок оформления Заказа указан в разделе&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать наименование &nbsp;раздела, где указан порядок оформления Заказа, а также указать прямую ссылку на соответствующий раздел Сайта</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">(</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">app</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">store</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">,&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">google</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">market</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">,&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">app</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">TALKTOME</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">)</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">3.6.</span>&nbsp;Совершая Акцепт Договор-Оферты, Пользователь выражает согласие на привлечение Исполнителем к исполнению Договора-Оферты других лиц (соисполнителей). В частности, Услуги оказываются&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">лица зарегистрированные как психолог оказывают услуги по консультации</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.</span></span>&nbsp;Принимая Акцепт Пользователя, Исполнитель выражает согласие на самостоятельное привлечение Пользователем по отдельным участкам или комплексам Услуг к исполнению третьих лиц (иных исполнителей).&nbsp;<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">4.</span>&nbsp;<strong>ЦЕНА, СРОК И ПОРЯДОК &nbsp;ОПЛАТЫ &nbsp;УСЛУГ</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">4.1.</span>&nbsp;Стоимость и единица измерения (объем, количество и (или) комплектность) оказываемых &nbsp;Услуг указана в разделе&nbsp;<span lang=\"RU\">карточки психолога указываются индивидуально зависимо от предпочитаемой стоимости за один час консультации</span>.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">4.2.</span>&nbsp;Стоимость Услуг включает в себя налог на добавленную стоимость.&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">4.3.</span>&nbsp;Оплата Услуг по соответствующему Заказу осуществляется Пользователем на условиях 100 % (стопроцентной) предварительной оплаты&nbsp;<em>&nbsp;в течение 5 (пяти) календарных дней с&nbsp;&nbsp;даты оформления Заказа</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">;&nbsp;</span></i></span><em>или, например</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.&nbsp;</span></span>Настоящим Стороны согласовали, что неисполнение или ненадлежащее исполнение Пользователем обязательства по оплате соответствующего Заказа освобождает Исполнителя от исполнения такого Заказа, т.е. Заказ считается не оформленным Пользователем, не полученным Исполнителем и соответственно не принятым к исполнению.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">4.4.</span>&nbsp;Оплата за Услуги осуществляется в безналичном порядке следующими способами:&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать способы оплаты</span></span><span lang=\"RU\"><o:p></o:p></span></p><ul type=\"disc\" style=\"margin-bottom: 0cm; letter-spacing: normal; text-align: start; color: rgb(0, 0, 0); font-size: medium;\"><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Платежной картой (VISA или MasterCard), или например,</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Через Терминалы оплаты</span></i></span><o:p></o:p></li><li class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"margin: 0cm; text-align: justify; font-size: 12pt;\"><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">Путем перевода денег на Банковский счет Исполнителя и т.д.)</span></i></span><o:p></o:p></li></ul><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">4.5.</span>&nbsp;Некоторые способы оплаты Услуг могут предусматривать обязательство Пользователя по оплате комиссии или платы за услуги лиц, осуществляющих прием и перечисление платежей, банка и т. п.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">5.</span>&nbsp;ПРИЕМКА-ПЕРЕДАЧА ОКАЗАННЫХ УСЛУГ<o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">5.1.</span>&nbsp;Не позднее&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">24 часов</span></span>&nbsp;с момента завершения оказания Услуг по соответствующему Заказу, Исполнитель обязуется своими силами и средствами представить Пользователю Акт выполненных работ (оказанных услуг)&nbsp;(далее - Акт)&nbsp;в двух подлинных экземплярах, подписанный со своей стороны. Наряду с Актом&nbsp;&nbsp;представляется в одном подлинном экземпляре Счет-фактура.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">5.2.</span>&nbsp;Не позднее чем через&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">12 часов&nbsp;</span></span>с момента получения&nbsp;<span lang=\"RU\">услуг, написать жалобу.&nbsp;</span>Если в течение указанного срока Исполнитель не получил обоснованного отказа&nbsp;<span lang=\"RU\">от услуг</span>, Услуги по соответствующему Заказу считаются оказанными в соответствии с условиями Договора-Оферты, без отступлений от Договора-Оферты, ухудшающих Услуги, или иных недостатков, в том числе по качеству, объему и сроку, и принятыми Пользователем без каких-либо претензий. При этом днем оказания Услуг по соответствующему Заказу является дата исполнения соответствующего Заказа, которая определяется по данным программно-технических средств Исполнителя.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.</span>&nbsp;<strong>СОГЛАСИЕ НА СБОР, ОБРАБОТКУ ПЕРСОНАЛЬНЫХ ДАННЫХ</strong><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.1.</span>&nbsp;<span data-mce-style=\"font-size: 9.0pt;mso-fareast-font-family: \'Times New Roman\';mso-bidi-font-family: Calibri;color: #444444;mso-fareast-language: RU;\">В соответствии с&nbsp;<span data-mce-style=\"background: fuchsia;mso-highlight: fuchsia;\">законодательством, регламентирующим отношения, связанные со Сбором, Обработкой Персональных данных</span>&nbsp;</span><span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-family: Calibri;color: #444444;\">при совершении Пользователем&nbsp;</span><span data-mce-style=\"font-size: 9.0pt;mso-fareast-font-family: \'Times New Roman\';mso-bidi-font-family: Calibri;color: #444444;mso-fareast-language: RU;\">Акцепт<span data-mce-style=\"background: fuchsia;mso-highlight: fuchsia;\">а</span>, в порядке определенном Договор<span data-mce-style=\"background: fuchsia;mso-highlight: fuchsia;\">ом</span>&nbsp;- Офертой, Пользователь дает безусловное согласие Исполнителю и&nbsp;</span><span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-family: Calibri;color: #444444;\">Третьим лицам на&nbsp;</span><span data-mce-style=\"font-size: 9.0pt;mso-fareast-font-family: \'Times New Roman\';mso-bidi-font-family: Calibri;color: #444444;mso-fareast-language: RU;\">Сбор, Обработку,&nbsp;<span data-mce-style=\"background: fuchsia;mso-highlight: fuchsia;\">т</span>рансграничную передачу (при необходимости)</span><span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-family: Calibri;color: #444444;\">&nbsp;Персональных данных Пользователя, не противоречащими законодательству способами, в целях, регламентированных&nbsp;</span><span data-mce-style=\"font-size: 9.0pt;mso-fareast-font-family: \'Times New Roman\';mso-bidi-font-family: Calibri;color: #444444;mso-fareast-language: RU;\">Договор<span data-mce-style=\"background: fuchsia;mso-highlight: fuchsia;\">ом</span>&nbsp;- Офертой</span><span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-family: Calibri;color: #444444;\">, и в источниках, в том числе общедоступных, по усмотрению Исполнителя, в связи с уже существующими или возникающими с Исполнителем или возникающих в будущем любых гражданско-правовых и (или) иных правоотношений</span>.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.2.</span>&nbsp;<span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-family: Calibri;color: #444444;\">Под Персональными данными Пользователя, Стороны определили нижеследующие сведения, относящиеся к Пользователю, а также происходящие в них в будущем изменения и (или) дополнения, зафиксированные на электронном, бумажном и (или) ином материальном носителе, включая, но, не ограничиваясь:</span><span data-mce-style=\"color: #9690ea;\"><span data-mce-style=\"font-size: 9pt;\">&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">(</span></span><em>&nbsp;фамилия, имя, отчество (при наличии), ИИН, дата рождения, гражданство, пол, место работы и должность, почтовый адрес (адрес места жительства, адрес регистрации (прописки)), домашний, рабочий, мобильный номера телефонов, адрес (а) электронной почты, указать иные необходимые Персональные данные)</em></span><span data-mce-style=\"font-size: 9pt;\">.<o:p></o:p></span></span></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.</span>&nbsp;Сбор, Обработка и&nbsp;трансграничная передача (при необходимости) Персональных данных Пользователя осуществляется Исполнителем для следующих целей, включая, но, не ограничиваясь:&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать необходимые цели</span></span>&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">(например,</span></i></span><o:p></o:p></p><p data-mce-style=\"margin-bottom: .0001pt;text-align: justify;line-height: 15.0pt;\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.1.</span>&nbsp;<em><span data-mce-style=\"font-size: 9pt;\"><span data-mce-style=\"color: #9690ea;\">в целях надлежащего исполнения&nbsp;</span><span data-mce-style=\"font-size: 9pt;\">Договора – Оферты, а также</span><span data-mce-style=\"font-size: 9pt;\">&nbsp;прав и обязанностей, возложенных на Исполнителя законодательством;</span></span></em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.2.</span>&nbsp;<em>для внутреннего контроля и учета Исполнителя;</em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.3.</span>&nbsp;<em>для судебной и внесудебной защиты прав Исполнителя: в случае нарушения обязательств по&nbsp;соответствующим сделкам; в случае возникновения спорных ситуаций,&nbsp;включая спорные ситуаций с третьими лицами;</em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.4.</span>&nbsp;<em>для проведения исследований, направленных на улучшение качества Услуг;</em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.3.5.</span>&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">для проведения маркетинговых программ, статистических исследований, а также для продвижения Услуг путем осуществления прямых контактов с Пользователем с помощью различных средств связи, включая, но, не ограничиваясь: почтовая рассылка, электронная почта, телефонная и (или) факсимильная связь, сеть Интернет и т.п.).</span></i></span><o:p></o:p></p><p data-mce-style=\"margin-bottom: .0001pt;text-align: justify;line-height: 15.0pt;\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.4.</span>&nbsp;<span data-mce-style=\"font-size: 9.0pt;mso-fareast-font-family: \'Times New Roman\';mso-bidi-font-family: Calibri;color: #444444;mso-fareast-language: RU;\">Пользователь, передавая Исполнителю Персональные данные по открытым каналам связи, осознает и принимает на себя риск несанкционированного получения их иными лицами и связанные с этим последствия. Исполнитель не несет ответственности при несанкционированном получении Персональных данных иными лицами при их передачи открытыми каналами связи.Пользователь, передавая Исполнителю Персональные данные по открытым каналам связи, осознает и принимает на себя риск несанкционированного получения их иными лицами и связанные с этим последствия. Исполнитель не несет ответственности при несанкционированном получении Персональных данных иными лицами при их передачи открытыми каналами связи.</span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">6.5.</span>&nbsp;<span data-mce-style=\"font-size: 9.0pt;mso-bidi-font-size: 11.0pt;line-height: 115%;font-family: \'Calibri\',\'sans-serif\';mso-fareast-font-family: \'Times New Roman\';color: #444444;mso-ansi-language: RU;mso-fareast-language: RU;mso-bidi-language: AR-SA;\"><span data-mce-style=\"font-size: 9.0pt;line-height: 115%;font-family: \'Calibri\',\'sans-serif\';mso-fareast-font-family: \'Times New Roman\';color: #444444;mso-ansi-language: RU;mso-fareast-language: RU;mso-bidi-language: AR-SA;\">Согласие Пользователя на&nbsp;Сбор, Обработку и трансграничную передачу (при необходимости) Персональных данных, регламентированное настоящим разделом&nbsp;может быть отозвано в случаях, регламентированных законодательством Республики Казахстан, на основании соответствующего заявления, оформленного в письменной форме, которое вручается Исполнителю в срок не менее чем&nbsp;</span><span lang=\"RU\">за сутки</span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span>до даты отзыва настоящего согласия. При этом, Пользователю известно, что настоящее согласие не может быть отозвано в случаях, если этот отзыв будет противоречить законодательству,&nbsp;либо при наличии не исполненных Пользователем обязательств перед Исполнителем.<o:p></o:p></span></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">7.</span>&nbsp;<strong>ОТВЕТСТВЕННОСТЬ СТОРОН</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.1.</span>&nbsp;За невыполнение и (или) ненадлежащее выполнение обязательств по Договору-Оферте Стороны несут ответственность в соответствии с Договором-Офертой и законодательством.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.2.</span>&nbsp;В случае невыполнения и (или) ненадлежащего выполнения обязательств Исполнителем Пользователь имеет право за каждый такой случай потребовать уплаты неустойки в размере&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">1</span></span>&nbsp;% (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">прописью</span></span>&nbsp;процентов)&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">определить сумму, от которой исчисляется неустойка&nbsp;</span></span><em>(например, от стоимости Услуг по соответствующему Заказу и т.п.)</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.3.</span>&nbsp;В случае выполнения обязательств Исполнителем с просрочкой Пользователь имеет право потребовать уплаты неустойки в размере&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">1</span></span>&nbsp;% (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">один процент</span></span>)&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">определить сумму, от которой исчисляется неустойка&nbsp;</span></span><em>, от стоимости Услуг по соответствующему Заказу</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">,</span></span>&nbsp;за&nbsp;<em>каждый месяц&nbsp;</em>&nbsp;просрочки исполнения.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.4.</span>&nbsp;В случае невыполнения и (или) ненадлежащего выполнения обязательств Пользователем Исполнитель имеет право за каждый такой случай потребовать уплаты неустойки в размере&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">цифры</span></span>&nbsp;<span lang=\"RU\">20</span>% (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">двадцать</span></span>&nbsp;процентов)&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">определить сумму, от которой исчисляется неустойка&nbsp;</span></span><em>(например, от стоимости Услуг по соответствующему Заказу и т.п.)</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">.</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.5.</span>&nbsp;В случае выполнения обязательств Пользователем с просрочкой Исполнитель имеет право потребовать уплаты неустойки в размере&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">цифры</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;<span lang=\"RU\">20</span></span></span>&nbsp;% (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">двадцать</span></span>&nbsp;процентов) за&nbsp;<em>каждый рабочий день</em>&nbsp;просрочки исполнения.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">7.6.</span>&nbsp;Стороны согласовали, что размер начисленной неустойки за каждый случай невыполнения и (или) ненадлежащего выполнения Стороной обязательств не может превышать&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">цифры</span></span>&nbsp;<span lang=\"RU\">25</span>% (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">двадцати пяти&nbsp;</span></span>процентов)<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">8.</span>&nbsp;<strong>ОБСТОЯТЕЛЬСТВА НЕПРЕОДОЛИМОЙ СИЛЫ (ФОРС-МАЖОР)</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.1.</span>&nbsp;Сторона освобождается от ответственности за частичное или полное неисполнение, или ненадлежащее исполнение обязательства, если это явилось следствием обстоятельств непреодолимой силы, возникших после заключения Договора в результате обстоятельств чрезвычайного характера, которые Сторона не могла предвидеть или предотвратить.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.2.</span>&nbsp;Под обстоятельствами непреодолимой силы понимаются: наводнение, пожар, землетрясение, стихийные явления, эпидемия, война или военные действия, а также решения органов государственной власти или управления.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.3.</span>&nbsp;При наступлении таких обстоятельств Сторона, испытывающая их действие, должна в течение&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">5 дней</span></span>&nbsp;известить о них в письменном виде другую Сторону.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.4.</span>&nbsp;Сторона, ссылающаяся на обстоятельства непреодолимой силы, должна представить другой Стороне официальные документы, удостоверяющие наличие этих обстоятельств и, по возможности, дающие оценку их влияния на возможность исполнения Стороной своих обязательств по Договору. Не требуют доказывания обстоятельства непреодолимой силы, имеющие общеизвестный характер.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.5.</span>&nbsp;Если Сторона, подвергшаяся воздействию обстоятельств непреодолимой силы, не направит регламентированные Договором документы, удостоверяющие наличие этих обстоятельств, то такая Сторона лишается права ссылаться на такие обстоятельства как на основание, освобождающее ее от ответственности за неисполнение или ненадлежащее исполнение обязательств по Договору.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">8.6.</span>&nbsp;В случаях наступления обстоятельств непреодолимой силы срок выполнения Стороной обязательств по Договору отодвигается соразмерно времени, в течение которого действуют эти обстоятельства и их последствия. Если наступившие обстоятельства непреодолимой силы и их последствия продолжают действовать более&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">5 дней</span></span>, Стороны проводят дополнительные переговоры для определения приемлемых альтернативных способов исполнения Договора, или обязательства Сторон прекращаются невозможностью исполнения (за исключением денежных обязательств) с момента возникновения обстоятельств непреодолимой силы.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">9.</span>&nbsp;<strong>РАЗРЕШЕНИЕ СПОРОВ</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.1.</span>&nbsp;Досудебное урегулирование спора осуществляется путем переговоров и предъявления претензий и является обязательным.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.2.</span>&nbsp;Стороны определяют следующий обязательный порядок досудебного урегулирования спора:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.2.1.</span>&nbsp;Претензия предъявляется в письменной форме и подписывается должным образом уполномоченным лицом.&nbsp;​​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.2.2.</span>&nbsp;В претензии указываются: требования, сумма претензии и обоснованный её расчет (если претензия подлежит денежной оценке); обстоятельства, на которых основываются требования, и доказательства, подтверждающие их; перечень прилагаемых к претензии документов и иных доказательств; иные сведения, необходимые для урегулирования спора.&nbsp;​​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.2.3.</span>&nbsp;Претензия рассматривается в течение&nbsp;десяти календарных дней со дня получения, и о результатах рассмотрения Сторона, направившая претензию, уведомляется в письменной форме. В ответе на претензию Сторона, получившая претензию, обязательно указывает мотивы принятия решения и предложения о порядке урегулирования спора.&nbsp;​​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">9.2.4.</span>&nbsp;Если к претензии не приложены документы, необходимые для её рассмотрения, они запрашиваются у Стороны, направившей претензию, в течение&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">5 дней&nbsp;</span></span>&nbsp;со дня получения претензии, с указанием срока представления (не менее&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">5 дней</span></span>). При неполучении затребованных документов к указанному сроку претензия рассматривается на основании имеющихся документов.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">10.</span>&nbsp;<strong>ПОРЯДОК ИЗМЕНЕНИЯ, РАСТОРЖЕНИЯ ДОГОВОРА - ОФЕРТЫ</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.</span>&nbsp;Стороны пришли к соглашению, что уведомлениями и (или) запросами Стороны по Договору – Оферте могут обмениваться в любой из ниже перечисленных форм:&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.1.</span>&nbsp;на бумажных носителях, направляемых:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.1.1.</span>&nbsp;по почте обязательно регистрируемым почтовым отправлением (заказным письмом), или<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.1.2.</span>&nbsp;нарочно под расписку получателя на экземпляре уведомления отправителя.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.2.</span>&nbsp;без применения бумажных носителей, посредством сообщений, направляемых по электронной почте:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.2.1.</span>&nbsp;от имени Исполнителя с электронного адреса, содержащего доменное имя<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\"><a href=\"mailto:passyukov@mail.ru\" style=\"color: blue; text-decoration-line: underline;\"><span style=\"color: black;\">passyukov</span><span lang=\"RU\" style=\"color: black;\">@</span><span style=\"color: black;\">mail</span><span lang=\"RU\" style=\"color: black;\">.</span><span style=\"color: black;\">ru</span></a></span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">talktome</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">app</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"EN-US\" style=\"color: black;\">&nbsp;</span></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">,</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.2.2.</span>&nbsp;от имени Пользователя с электронного адреса, указанного при&nbsp;<em>регистрации&nbsp;</em><em><span lang=\"RU\">в приложении</span></em><span lang=\"RU\"><o:p></o:p></span></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.3.</span>&nbsp;Уведомление и (или) запрос, передаваемые в форме сообщения по электронной почте, должны содержать:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.3.1.</span>&nbsp;в теме (subject) сообщения - тема уведомления и (или) запроса,<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.1.3.2.</span>&nbsp;в тексте сообщения - информация, необходимая для рассмотрения запроса или информация достаточная для понимания представленного уведомления. Стороны отдельно пришли к заключению, что письма, отправленные с иных электронных адресов, в ином от вышеописанных форм виде могут не рассматриваться.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.2.</span>&nbsp;Стороны пришли к соглашению, что Исполнитель вправе по своему усмотрению изменить и (или) дополнить Договор – Оферту, в том числе &nbsp;условия и (или) порядок оказания Услуг, объем, количество и (или) комплектность Услуг, их стоимость. При этом:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.2.1.</span>&nbsp;уведомление Пользователя о таких изменениях и (или) дополнениях осуществляется любым общедоступным способом, в том числе&nbsp;<em>путем&nbsp;</em><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">размещения информации&nbsp;</span></i></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span lang=\"RU\" style=\"color: black;\">в приложении</span></i></span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><i><span style=\"color: black;\">&nbsp;и (или) направления уведомления Пользователю посредством электронной почты&nbsp;</span></i></span>не менее, чем за&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">пяти дней</span></span>&nbsp;до вступления изменений и (или) дополнений в силу. В случае несогласия Пользователя с изменениями и (или) дополнениями вносимыми в Договор - Оферту, он обязан письменно уведомить об этом Исполнителя до их вступления в силу&nbsp;и (или) прекратить пользование Услугам. Стороны согласовали, что отсутствие такого письменного уведомления со стороны Пользователя рассматривается как его согласие на изменения и (или) дополнения Договора – Оферты, предложенные Исполнителем. Договор - Оферта считается измененным и (или) дополненным с момента, указанного в уведомлении Исполнителя и на его основании, без подписания каких-либо дополнительных соглашений к Договору – Оферте;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.2.2.</span>&nbsp;в целях обеспечения возможности хранить и воспроизводить условия Договора-Оферты на момент присоединения Пользователя к Договору-Оферте при совершении Пользователем Акцепта в порядке, регламентированном Договором - Офертой, Исполнитель предоставляет Пользователю возможность<em>&nbsp;скачать текст Договора - Оферты &nbsp;нажав кнопку \"скачать\" внизу текста);</em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.2.3.</span>&nbsp;действующая редакция &nbsp; Договора - Оферты размещается на Сайте.&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.3.</span>&nbsp;Стороны пришли к соглашению, что Исполнитель вправе по своему усмотрению изменить и (или) дополнить Договор - Оферту в&nbsp;любой момент как с&nbsp;уведомлением Пользователей, так и&nbsp;без него. При этом:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.3.1.</span>&nbsp;услуги, на которые Пользователем оформлен Заказ, до внесения изменений и (или) &nbsp;дополнений в Договор - Оферту Исполнитель оказывает на условиях, согласованных в Заказе;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.3.2.</span>&nbsp;после внесения изменений и (или) &nbsp;дополнений в Договор – Оферту Услуги оказываются Пользователям в соответствии с измененными и (или) дополненными условиями;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.3.3.</span>&nbsp;в целях обеспечения возможности хранить и воспроизводить условия Договора-Оферты на момент присоединения Пользователя к Договору-Оферте при совершении Пользователем Акцепта в порядке, регламентированном Договором - Офертой, Исполнитель предоставляет Пользователю возможность<em>, скачать текст Договора - Оферты &nbsp;нажав кнопку \"скачать\" внизу текста).</em><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.3.4.</span>&nbsp;Действующая редакция &nbsp; Договора - Оферты размещается на Сайте.&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.4.</span>&nbsp;Расторжение Договора-Оферты возможно по соглашению Сторон, а также в случае одностороннего отказа от исполнения Договора-Оферты (отказа от Договора - Оферты) по основаниям, предусмотренным Договором-Офертой и законодательством.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.5.</span>&nbsp;Предложение о расторжении Договора - Оферты по соглашению Сторон направляется другой Стороне в срок не менее чем за&nbsp;<span lang=\"RU\">3 дней&nbsp;</span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">указать прописью срок</span></span>&nbsp;до предлагаемой даты расторжения. Расторжение Договора-Оферты по соглашению Сторон совершается в той же форме, что и Договор-Оферта, &nbsp;путем составления двустороннего соглашения или в иной письменной форме, определенной законодательством.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.6.</span>&nbsp;Односторонний отказ от исполнения Договора-Оферты производится по письменному уведомлению, направляемому другой Стороне в срок не менее чем за&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">3 дней&nbsp;</span></span>&nbsp;до даты отказа от исполнения Договора - Оферты. Стороны согласовали, что уведомление может быть направлено любым из ниже перечисленных способом:&nbsp;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.6.1.</span>&nbsp;посредством электронной почты;&nbsp;​<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.6.2.</span>&nbsp;по почте обязательно регистрируемым почтовым отправлением (заказным письмом);<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.6.3.</span>&nbsp;нарочно под расписку на экземпляре уведомления отправителя.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.</span>&nbsp;К установленным законодательством Стороны Договором-Офертой согласовали иные случаи, обусловленные нарушением Стороной Договора-Оферты, при которых другая Сторона вправе отказаться от Договора:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.1.</span>&nbsp;По инициативе Пользователя:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.1.1.</span>&nbsp;неоднократное (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">трех</span></span>&nbsp;раз и более) невыполнение и (или) ненадлежащее выполнение Исполнителем принятых обязательств, регламентированных Договором-Офертой;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.1.2.</span>&nbsp;просрочка Исполнителем выполнения обязательств, регламентированных Договором-Офертой, на срок более&nbsp;<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">пяти дней</span></span>;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.1.3.</span>&nbsp;невыполнение и (или) ненадлежащее выполнение обязательств, регламентированных&nbsp;&nbsp;Договором-Офертой.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.2.</span>&nbsp;По инициативе Исполнителя:<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.2.1.</span>&nbsp;неоднократное (<span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span lang=\"RU\" style=\"color: black;\">3&nbsp;</span></span>&nbsp;раз и более) невыполнение и (или) ненадлежащее выполнение Пользователем принятых обязательств, регламентированных Договором-Офертой;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.2.2.</span>&nbsp;просрочка Пользователем выполнения обязательств, регламентированных &nbsp;Договором-Офертой, на срок&nbsp;<span lang=\"RU\">3 дней</span><span class=\"userinput1\" style=\"color: rgb(10, 70, 200);\"><span style=\"color: black;\">;</span></span><o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">10.7.2.3.</span>&nbsp;невыполнение и (или) ненадлежащее выполнение Пользователем обязательств, регламентированных &nbsp;Договором-Офертой.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0cm=\"\" 8pt;=\"\" font-size:=\"\" 14pt;=\"\" text-align:=\"\" justify;\"=\"\"><span class=\"number\">11.</span>&nbsp;<strong>ЗАКЛЮЧИТЕЛЬНЫЕ ПОЛОЖЕНИЯ</strong><o:p></o:p></h4><h4 align=\"center\" style=\"margin: 16pt 0cm 8pt; text-align: center; font-size: 14pt; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\"><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">11.1.</span>&nbsp;Договор - Оферта, а также все правоотношения, возникающие в связи с исполнением Договора - Оферты, регулируются и подлежат толкованию в соответствии с законодательством Республики Казахстан.<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">11.2.</span>&nbsp;Договор - Оферта вступает в силу с момента ее Акцепта и действует до&nbsp;&nbsp;момента полного исполнения Сторонами принятых на себя обязательств.<o:p></o:p></p><p class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 0cm 0cm 12pt; letter-spacing: normal; text-align: start; font-size: 12pt;\"><br><span lang=\"RU\">ИП Пасюков Сергей Евгеньевич<o:p></o:p></span></p><p class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 0cm 0cm 12pt; letter-spacing: normal; text-align: start; font-size: 12pt;\"><span lang=\"RU\">Приложение&nbsp;</span><span lang=\"EN-US\">talktome<o:p></o:p></span></p><p class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 0cm 0cm 12pt; letter-spacing: normal; text-align: start; font-size: 12pt;\"><span lang=\"EN-US\">Talktome.one<o:p></o:p></span></p><p class=\"MsoNormal\" times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 0cm 0cm 12pt; letter-spacing: normal; text-align: start; font-size: 12pt;\"><span lang=\"RU\">&nbsp;</span><span style=\"color: rgb(54, 54, 54); font-family: Arial, sans-serif; font-size: 13pt; letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 13.5pt;\"><span style=\"font-size: 13pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">Платежи. Оплата банковской картой онлайн<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Наш сайт подключен к интернет-эквайрингу, и Вы можете оплатить Услугу банковской картой Visa или Mastercard. После подтверждения выбранного Товара либо услуги откроется защищенное окно с платежной страницей процессингового центра CloudPayments, где Вам необходимо ввести данные Вашей банковской карты. Для дополнительной аутентификации держателя карты используется протокол 3-D Secure. Если Ваш Банк-эмитент поддерживает данную технологию, Вы будете перенаправлены на его сервер для прохождения дополнительной идентификации. Информацию о правилах и методах дополнительной идентификации уточняйте в Банке, выдавшем Вам банковскую карту.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>Услуга онлайн-оплаты осуществляется в соответствии с правилами Международных платежных систем Visa и MasterCard на принципах соблюдения конфиденциальности и безопасности совершения платежа, для этого используются самые актуальные методы проверки, шифрования и передачи данных по закрытым каналам связи. Ввод данных банковской карты осуществляется в защищенном окне на платежной странице CloudPayments.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>В поля на платежной странице требуется ввести номер карты, имя владельца карты, срок действия карты, трёхзначный код безопасности (CVV2 для VISA или CVC2 для MasterCard). Все необходимые данные отображены на поверхности банковской карты.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">CVV2/ CVC2 — это трёхзначный код безопасности, находящийся на оборотной стороне карты.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Далее в том же окне откроется страница Вашего банка-эмитента для ввода 3-D Secure кода. В случае, если у вас не настроен статичный 3-D Secure, он будет отправлен на ваш номер телефона посредством SMS. Если 3-D Secure код к Вам не пришел, то следует обратиться в ваш банк-эмитент.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>3-D Secure — это самая современная технология обеспечения безопасности платежей по картам в сети интернет. Позволяет однозначно идентифицировать подлинность держателя карты, осуществляющего операцию, и максимально снизить риск мошеннических операций по карте.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">Гарантии безопасности<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Процессинговый центр CloudPayments защищает и обрабатывает данные Вашей банковской карты по стандарту безопасности PCI DSS 3.0. Передача информации в платежный шлюз происходит с применением технологии шифрования SSL. Дальнейшая передача информации происходит по закрытым банковским сетям, имеющим наивысший уровень надежности. CloudPayments не передает данные Вашей карты нам и иным третьим лицам. Для дополнительной аутентификации держателя карты используется протокол 3-D Secure.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>В случае, если у Вас есть вопросы по совершенному платежу, Вы можете обратиться в службу поддержки клиентов платежного сервиса по электронной почте&nbsp;</span><a href=\"mailto:support@cloudpayments.kz\"><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(33, 183, 207); letter-spacing: -0.1pt;\">support@cloudpayments.kz</span></b></a><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">Безопасность онлайн-платежей<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Предоставляемая Вами персональная информация (имя, адрес, телефон, e-mail, номер кредитной карты) является конфиденциальной и не подлежит разглашению. Данные Вашей кредитной карты передаются только в зашифрованном виде и не сохраняются на нашем Web-сервере.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>Мы рекомендуем вам проверить, что ваш браузер достаточно безопасен для проведения платежей онлайн, на&nbsp;</span><a href=\"https://my.cloudpayments.ru/ru/browser\"><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(33, 183, 207); letter-spacing: -0.1pt;\">специальной странице</span></b></a><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><br>Безопасность обработки Интернет-платежей гарантирует ТОО «CloudPayments Kazakhstan». Все операции с платежными картами происходят в соответствии с требованиями VISA International, MasterCard и других платежных систем. При передаче информации используются специализированные технологии безопасности карточных онлайн-платежей, обработка данных ведется на безопасном высокотехнологичном сервере процессинговой компании.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Оплата платежными картами безопасна, потому что:<o:p></o:p></span></p><ul type=\"disc\" style=\"font-size: 13px; letter-spacing: normal; text-align: start;\"><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">Система авторизации гарантирует покупателю, что платежные реквизиты его платежной карты (номер, срок действия, CVV2/CVC2) не попадут в руки мошенников, так как эти данные не хранятся на сервере авторизации и не могут быть похищены.<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">Покупатель вводит свои платежные данные непосредственно в системе авторизации CloudPayments, а не на сайте интернет-магазина, следовательно, платежные реквизиты карточки покупателя не будут доступны третьим лицам.<o:p></o:p></span></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;&nbsp;&nbsp;<img border=\"0\" width=\"211\" height=\"153\" src=\"file:///C:/Users/ELSS-A~1/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg\" alt=\"MasterCard SecureCode\" v:shapes=\"Рисунок_x0020_2\">&nbsp;&nbsp;&nbsp;<img border=\"0\" width=\"170\" height=\"55\" src=\"file:///C:/Users/ELSS-A~1/AppData/Local/Temp/msohtmlclip1/01/clip_image004.png\" alt=\"Verifyed By Visa\" v:shapes=\"Рисунок_x0020_1\">&nbsp;&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">Возврат денежных средств</span></b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">При проведении онлайн-оплаты посредством платежных карт не допускается возврат наличными денежными средствами. Порядок возврата регулируется правилами международных платежных систем:<o:p></o:p></span></p><ol start=\"1\" type=\"1\" style=\"font-size: 13px; letter-spacing: normal; text-align: start;\"><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">Потребитель вправе отказаться от товара в любое время до его передачи, после передачи товара отказ необходимо оформить в течение 14 дней;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">Возврат товара надлежащего качества возможен в случае, если сохранены его товарный вид, потребительские свойства, а также документ, подтверждающий факт и условия покупки указанного товара;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">Потребитель не вправе отказаться от товара надлежащего качества, имеющего индивидуально-определенные свойства, если указанный товар может быть использован исключительно приобретающим его человеком;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">При отказе от товара со стороны потребителя продавец должен вернуть ему денежную сумму, уплаченную потребителем, не позднее чем через десять дней со дня предъявления потребителем соответствующего требования.<o:p></o:p></span></li></ol><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 15pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\">Для возврата денежных средств на банковскую карту необходимо заполнить «Заявление о возврате денежных средств», которое высылается по требованию компанией на электронный адрес, и отправить его вместе с приложением копии документа, удостоверяющего личность, по адресу&nbsp;</span><b><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">talktome</span></b><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">.</span></b><b><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">app</span></b><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">@</span></b><b><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">protonmail</span></b><b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">.</span></b><b><span lang=\"EN-US\" style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(163, 21, 21); letter-spacing: -0.1pt;\">com</span></b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spaci