ата денежных средств начинает исчисляться с момента получения Компанией Заявления и рассчитывается в рабочих днях без учета праздников/выходных дней.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">&nbsp;</span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 13px; letter-spacing: normal; text-align: start; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\"><b><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: black; letter-spacing: -0.1pt;\">Случаи отказа в совершении платежа:</span></b><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; color: rgb(54, 54, 54); letter-spacing: -0.1pt;\"><o:p></o:p></span></p><ul type=\"disc\" style=\"font-size: 13px; letter-spacing: normal; text-align: start;\"><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">банковская карта не предназначена для совершения платежей через интернет, о чем можно узнать, обратившись в Ваш Банк-эмитент;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">недостаточно средств для оплаты на банковской карте. Подробнее о наличии средств на платежной карте Вы можете узнать, обратившись в банк, выпустивший банковскую карту;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">данные банковской карты введены неверно;<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color: rgb(54, 54, 54); line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif; letter-spacing: -0.1pt;\">истек срок действия банковской карты. Срок действия карты, как правило, указан на лицевой стороне карты (это месяц и год, до которого действительна карта). Подробнее о сроке действия карты Вы можете узнать, обратившись в банк-эмитент.<o:p></o:p></span></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; font-size: 