f;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.11.</span>&nbsp;<b>Персональные данные</b>&nbsp;- сведения, регламентированные Договором - Офертой, относящиеся к определенному физическому лицу, зафиксированные на электронном, бумажном и (или) ином материальном носителе;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.12.</span>&nbsp;<b>Сбор Персональных данных</b>&nbsp;– действия, направленные на получение Персональных данных;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.13.</span>&nbsp;<strong>Обработка Персональных данных</strong>&nbsp;– действия, направленные на накопление, хранение, изменение, дополнение, использование, распространение, обезличивание, блокирование и уничтожение Персональных данных;<o:p></o:p></p><p times=\"\" new=\"\" roman\",=\"\" serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\" style=\"margin: 8pt 0cm; letter-spacing: normal; text-align: justify; font-size: 12pt;\"><span class=\"number\">1.14.</span>&nbsp;<strong>Третьи лица</strong>&nbsp;- &nbsp;лица связанные, как в настоящее время, так и в будущем, с Исполнителем обстоятельствами или правоотношениями по Сбору, Обработке и защите Персональных данных&nbsp;Пользователя.<o:p></o:p></p></h4><h4 times=\"\" new=\"\" roman\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);=\"\" letter-spacing:=\"\" normal;\"=\"\" style=\"font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" line-height:=\"\" 1.53846;=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin:=\"\" 16pt=\"\" 0c